import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the featured products grid (using ID selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card by XPath (div with class 'product-card')
    const productCard = await page.waitForSelector('//div[contains(@class,"product-card")]', { timeout: 5000 });

    // Take screenshot before opening modal
    const beforeModalShot = path.join(screenshotsDir, 'step_2_before_modal.png');
    await page.screenshot({ path: beforeModalShot });
    screenshots.push(beforeModalShot);

    // Click the first product card to open the Product Detail Modal
    await productCard.click();

    // Wait for the modal to appear (using ID and class selectors together)
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of the opened modal
    const modalShot = path.join(screenshotsDir, 'step_3_modal_opened.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract product title from the modal
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());

    // Extract price from the modal
    const productPrice = await page.$eval('.product-detail-price', el => el.textContent.replace(/\s+/g, ' ').trim());

    return {
      success: true,
      action: "Opened the Product Detail Modal for the first featured product",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
